export function Rllista(props) {
  return (
    <table>
      <thead>
        <tr>
          {props.header.map((item) => (
            <th>{item.header}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {props.data.map((item, index) => (
          <tr key={index}>
            {props.header.map((headerItem) => (
              <td key={headerItem.name}>{item[headerItem.name]}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
}
